	ViewPoint: {
		speed: 6
	},
	//IMAGEMAPOBJECT
	ImageMapObjectFactory: {
		returnArray: false,
		result: [],
        Clear: function()
        {
            this.result = [];
            return this;
        },
		Create: function(idX, idY, idZ, spriteFrameIdx, spriteSheet, title, tId)
		{
			var immediateResult;
			if(this.returnArray == true)
			{
				immediateResult = [idX,idY,spriteFrameIdx,spriteSheet,title,tId];
			}
			else
			{
				if($.isArray(idX))
				{
					immediateResult = {
						idX: idX[0],
						idY: idX[1],
						idZ: idX[2],
						spriteFrameIdx: idX[3],
						spriteSheet: idX[4],
						title: idY,	//In the case the object is an array, the idY is the title
                        tId: tId
					};
				}
				else
				{
					immediateResult = {
						idX: idX,
						idY: idY,
						idZ: idZ,
						spriteFrameIdx: spriteFrameIdx,
						spriteSheet: spriteSheet,
                        title: title,
                        tId: tId
					};
				}
			}
			this.result.push(immediateResult);
			return immediateResult;
		},
		
		CreateFromDOM: function(el, resetResult)
		{
			//Assumes it is a list item
			if(resetResult === true)
				this.result = [];
			el.each(function(){
				//list
				var _li = [];
				$(this).children().each(function(){
					_li.push(parseInt($(this).text()));
				});
				Core.ImageMapObjectFactory.Create(_li, $(this).attr('id'));
			});
			return this;
		},
		
		ExtractResultToMap: function(v, result){
			if(v.imageMapAboveFloorObj)
				if(result)
					v.imageMapAboveFloorObj.push(result);
				else	
					v.imageMapAboveFloorObj = this.result;
			//automatically sorts
			v.imageMapAboveFloorObj.sort(function(a,b){return (b.idX-a.idX)-(b.idY-a.idY)-(b.idZ-a.idZ);});
			return this;
		}
	},
